INSERT INTO `questions` VALUES (1,'Risk transfer through risk pooling is called ________.','Savings','Investments','Insurance','Risk mitigation','Savings','0'),(2,'.The measures to reduce chances of occurrence of risk are known as _____.','Risk retention','Loss prevention','Risk transfer','Risk avoidance','Loss prevention','0'),(3,'By transferring risk to insurer, it becomes possible ___________.','To become careless about our assets','To make money from insurance in the event of a loss','To ignore the potential risks facing our assets','enjoy peace of mind and plan oneâ€™s business more effectively','enjoy peace of mind and plan oneâ€™s business more effectively','0'),(4,'Origins of modern insurance business can be traced to __________.','Bottomry','Lloyds','Rhodes','Malhotra Committee','Lloyds','0'),(5,'In insurance context â€˜risk retentionâ€™ indicates a situation where _____.','Possibility of loss or damage is not there','Loss producing event has no value','Property is covered by insurance','One decides to bear the risk and its effects','One decides to bear the risk and its effects','0'),(6,'Which of the following statement is true?','Insurance protects the asset','Insurance prevents its loss','Insurance reduces possibilities of loss','Insurance pays when there is loss of asset','Insurance pays when there is loss of asset','0'),(7,'Which of the following statements is true?','Insurance is a method of sharing the losses of a â€˜fewâ€™ by â€˜manyâ€™','Insurance is a method of transferring the risk of an individual to another individual','Insurance is a method of sharing the losses of a â€˜manyâ€™ by a few','Insurance is a method of transferring the gains of a few to the many','Insurance is a method of sharing the losses of a â€˜fewâ€™ by â€˜manyâ€™','0'),(8,'Why do insurers arrange for survey and inspection of the property before acceptance of a risk?','To assess the risk for rating purposes','To find out how the insured purchased the property','To find out whether other insurers have also inspected the property','To find out whether neighbouring property also can be insured','To assess the risk for rating purposes','0'),(9,'Which of the below option best describes the process of insurance?','Sharing the losses of many by a few','Sharing the losses of few by many','One sharing the losses of few','Sharing of losses through subsidy','Sharing the losses of few by many','0'),(10,'_____________ is not a tangible good.','House','Insurance','Mobile Phone','A pair of jeans','Insurance','0'),(11,'_______________ is not an indicator of service quality.','Cleverness','Reliability','Empathy','Responsiveness','Cleverness','0'),(12,'In India _______________ insurance is mandatory','Motor third party liability','Fire insurance for houses','Travel insurance for domestic travel','Personal accident','Motor third party liability','0'),(13,'One of the methods of reducing insurance cost of an insured is __________','Reinsurance','Deductible','Co-insurance','Rebate','Deductible','0'),(14,'A customer having complaint regarding his insurance policy can approach IRDA through','IGMS','District Consumer Forum','Ombudsman','IGMS or District Consumer Forum or Ombudsman','IGMS','0'),(15,'Consumer Protection Act deals with:','Complaint against insurance companies','Complaint against shopkeepers','Complaint against brand','Complaint against insurance companies, brand and shopkeepers','Complaint against insurance companies, brand and shopkeepers','0'),(16,'___________ has jurisdiction to entertain matters where value of goods or services and the compensation claim is up to 20 lakhs','High Court','District Forum','State Commission','National Commission','District Forum','0'),(17,'In customer relationship the first impression is created:','By being confident','By being on time','By showing interest','By being on time, showing interest and being confident','By being on time, showing interest and being confident','0'),(18,'Select the correct statement:','Ethical behaviour is impossible while selling insurance','Ethical behaviour is not necessary for insurance agents','Ethical behaviour helps in developing trust between the agent and theinsurer','Ethical behaviour is expected from the top management only','Ethical behaviour helps in developing trust between the agent and theinsurer','0'),(19,'Active Listening involves:','Paying attention to the speaker','Giving an occasional nod and smile','Providing feedback','Paying attention to the speaker, giving an occasional nod and smile and providing feedback','Paying attention to the speaker, giving an occasional nod and smile and providing feedback','0'),(20,'Expand the term IGMS.','Insurance General Management System','Indian General Management System','Integrated Grievance Management System','Intelligent Grievance Management System','Integrated Grievance Management System','0'),(21,'Which of the below consumer grievance redressal agencies would handle consumer disputes amounting between Rs. 20 lakhs and Rs. 100 lakhs?','District Forum','State Commission','National Commission','Zilla Parishad','State Commission','0'),(22,'Which among the following cannot form the basis for a valid consumer complaint?','Shopkeeper charging a price above the MRP for a product','Shopkeeper not advising the customer on the best product in a category','Allergy warning not provided on a drug bottle','Faulty products','Shopkeeper not advising the customer on the best product in a category','0'),(23,'Which of the below will be the most appropriate option for a customer to lodge an insurance policy related complaint?','Police','Supreme Court','Insurance Ombudsman','District Court','Insurance Ombudsman','0'),(24,'Which of the below statement is correct with regards to the territorial jurisdiction of the Insurance Ombudsman?','Insurance Ombudsman has National jurisdiction','Insurance Ombudsman has State jurisdiction','Insurance Ombudsman has District jurisdiction','Insurance Ombudsman operates only within the specified territorial limits','Insurance Ombudsman operates only within the specified territorial limits','0'),(25,'How is the complaint to be launched with an insurance ombudsman?','The complaint is to be made in writing','The complaint is to be made orally over the phone','The complaint is to be made orally in a face to face manner','The complaint is to be made through newspaper advertisement','The complaint is to be made in writing','0'),(26,'What is the time limit for approaching an Insurance Ombudsman?','Within two years of rejection of the complaint by the insurer','Within three years of rejection of the complaint by the insurer','Within one year of rejection of the complaint by the insurer','Within one month of rejection of the complaint by the insurer','Within one year of rejection of the complaint by the insurer','0'),(27,'Which among the following is not a pre-requisite for launching a complaint with the Ombudsman?','The complaint must be by an individual on a â€˜Personal Linesâ€™ insurance','The complaint must be lodged within 1 year of the insurer rejecting the complaint','Complainant has to approach a consumer forum prior to the Ombudsman','The total relief sought must be within an amount of Rs.20 lakhs.','Complainant has to approach a consumer forum prior to the Ombudsman','0'),(28,'Are there any fee / charges that need to be paid for lodging the complaint with the Ombudsman','A fee of Rs 100 needs to be paid','No fee or charges need to be paid','20% of the relief sought must be paid as fee','10% of the relief sought must be paid as fee','No fee or charges need to be paid','0'),(29,'Can a complaint be launched against a private insurer?','Complaints can be launched against public insurers only','Yes, complaint can be launched against private insurers','Complaint can be launched against private insurers only in the Life Sector','Complaint can be launched against private insurers only in the Non-Life Sector','Yes, complaint can be launched against private insurers','0'),(30,'Which element of a valid contract deals with premium?','Offer and acceptance','Consideration','Free consent','Capacity of parties to contract','Consideration','0'),(31,'_____________ relates to inaccurate statements, which are made without any fraudulent intention.','Misrepresentation','Contribution','Offer','Representation','Misrepresentation','0'),(32,'________________ involves pressure applied through criminal means','Fraud','Undue influence','Coercion','Mistake','Coercion','0'),(33,'Which among the following is true regarding life insurance contracts?','They are verbal contracts not legally enforceable','They are verbal which are legally enforceable','They are contracts between two parties (insurer and insured) as perrequirements of Indian Contract Act, 1872','They are similar to wager contracts','They are contracts between two parties (insurer and insured) as perrequirements of Indian Contract Act, 1872','0'),(34,'Which of the below is not a valid consideration for a contract?','Money','Property','Bribe','Jewellery','Bribe','0'),(35,'Which of the below party is not eligible to enter into a life insurance contract?','Business owner','Minor','House wife','Government employee','Minor','0'),(36,'Which of the below action showcases the principle of â€œUberrima Fidesâ€?','Lying about known medical conditions on an insurance proposal form','Not revealing known material facts on an insurance proposal form','Disclosing known material facts on an insurance proposal form','Paying premium on time','Disclosing known material facts on an insurance proposal form','0'),(37,'Which of the below is not correct with regards to insurable interest?','Father taking out insurance policy on his son','Spouses taking out insurance on one another','Friends taking out insurance on one another','Employer taking out insurance on employees','Friends taking out insurance on one another','0'),(38,'When is it essential for insurable interest to be present in case of life insurance?','At the time of taking out insurance','At the time of claim','Insurable interest is not required in case of life insurance','Either at time of policy purchase or at the time of claim','At the time of taking out insurance','0'),(39,'Find out the proximate cause for death in the following scenario? Ajay falls off a horse and breaks his back. He lies there in a pool of water and contracts pneumonia. He is admitted to the hospital and dies because of pneumonia.','Pneumonia','Broken back','Falling off a horse','Surgery','Falling off a horse','0'),(40,'Which of the below is not an element of the life insurance business?','Asset','Risk','Principle of mutuality','Subsidy','Subsidy','0'),(41,'Who devised the concept of HLV?','Dr. Martin Luther King','Warren Buffet','Prof. Hubener','George Soros','Prof. Hubener','0'),(42,'Which of the below mentioned insurance plans has the least or no amount of savings element?','Term insurance plan','Endowment plan','Whole life plan','Money back plan','Term insurance plan','0'),(43,'.Which among the following cannot be termed as an asset?','Car','Human Life','Air','House','Air','0'),(44,'Which of the below cannot be categorised under risks?','Dying too young','Dying too early','Natural wear and tear','Living with disability','Natural wear and tear','0'),(45,'Which among the following methods is a traditional method that can help determine the insurance needed by an individual?','Human Economic Value','Life Term Proposition','Human Life Value','Future Life Value','Human Life Value','0'),(46,'Which of the below is the most appropriate explanation for the fact that young people are charged lesser life insurance premium as compared to old','Young people are mostly dependant','Old people can afford to pay more','Mortality is related to age','Mortality is inversely related to age','ortality is related to age','0'),(47,'Which of the below is not an advantage of cash value insurance contracts?','Safe and secure investment','Inculcates saving discipline','Lower yields','Income tax advantages','Lower yields','0'),(48,'Which of the below is an advantage of cash value insurance contracts?','Returns subject to corroding effect of inflation','Low accumulation in earlier years','Lower yields','Secure investment','Secure investment','0'),(49,'The ________ the premium paid by you towards your life insurance, the ________ will be the compensation paid to the beneficiary in the event','Higher, Higher','Lower, Higher','Higher, Lower','Faster, Slower','Higher, Higher','0'),(50,'In decreasing-term insurance, the premiums paid ____________ over time.','Increase','Decrease','Remain constant','Are returned','Remain constant','0');
